import React from 'react';


class Home extends React.Component {

    constructor(props){
        super(props);
        this.state = {
            cars_list: []

        }
    }

    componentDidMount(){

        this.setState({
            cars_list: [
                {make: 'Audi', model: 'A3'},
                {make: 'BMW', model: 'M4'},
                {make: 'Mazda', model: 'Miata'}
            ]

        })


        /* 
        let options = {
            method: 'GET',
            mode: 'cors',
            headers: {
                'Content-Type': 'application/json'
            }
        }

        fetch('http://localhost/4000/cars', options)
            .then((res)=>{
                if (res.status != 200){
                    console.log('Error retrieving cars list from server: 200');
                }
                else{
                    return res.json();
                }

            })
            .then((data)=>{
                this.setState(cars_list = data.cars);
            });



            */
    }




    render(){



        const listElement = this.state.cars_list.map((car)=>{
            return
                                <li class="list">
                                    <div class="make">{car.make}</div>
                                    <div class="model">{car.model}</div>
                                </li>
                            })




        return (
            <div>

                <div class="image">
                    <h2 class="number">{this.state.num_cars}</h2>
                    <h2 class="title">US Manual Transmission Cars Remaining</h2>
                </div>

                <div id="divChart">
                    <canvas id="myChart"></canvas>
                </div>

                <li class="listing">
                    {listElement}
                </li>

                <div class="footer">
                    <div style="font-size: 18px; color:inherit"> 
                        Photo Source 
                    </div>
                    <br/>
                    <div style="font-size: 14px; color: inherit"> 
                        https://pixabay.com/users/stocksnap-894430/
                    </div>
                    <br/>
                    <br/>

                </div>



            </div> 
        )
    }

}

export default Home;
